        e.preventDefault();
        const id = e.target.getAttribute('href').replace('#', '');

        tabItem.forEach((child) => child.classList.remove('calc-tabs__triggers-item--active'));
        contentItem.forEach((child) => child.classList.remove('calc-tabs__content-item--active'));

